(5, 57, 'MIDLANDS RECOVERY CENTER', 'Muradnagar, Uttar Pradesh, India', '28.7718326', '77.5074593', NULL, '<h1><span style=\"color: #3598db;\"><em>WELCOME <strong>TO MIDLANDS RECOVERY CENTER</strong></em></span></h1>\n<hr />\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>The Midlands Recovery Center is a bridge between treatment and long-term recovery. Whether in crisis, new to recovery, post-relapse or after treatment, we offer peer support and the stability needed for your success.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>We offer hope, recovery skills, and mental wellness in a supportive and safe environment for people seeking recovery from substance use and co-occurring disorders.</p>\n<p>&nbsp;</p>\n<p>Also we provide peer-driven support in a safe, non-judgemental environment while allowing our peers to experience and thrive in recovery. We help rebuild relationships, find housing and employment opportunities, offer mental and emotional support, and provide relapse prevention skills.</p>\n<h5>&nbsp;</h5>\n<h5>&nbsp;</h5>\n<h5><span style=\"color: #236fa1;\"><strong><em>&ndash; THIS IS OUR STORY</em></strong></span></h5>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">In 2017, the&nbsp;<a href=\"https://www.ncbi.nlm.nih.gov/books/NBK458661/#sec_000139\" target=\"_blank\" rel=\"noopener noreferrer\">opiate epidemic</a>&nbsp;began to rapidly claim lives across South Carolina and the rest of the United States.&nbsp; It became clear that traditional treatment and rehabilitation services could not handle the influx of patients addicted to opiates.</div>\n<div>&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">So, in an effort to combat the revolving door, along with two deaths close to me that resulted from a lack of availability of services, the idea of Midlands Recovery Center was born.</div>\n<div>&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">With the understanding that you will not solve the drug problem by stopping supply, we cultivated the idea for a community-based recovery program. We did this in order to combat demand, addiction and the destruction that follows.</div>\n<div>&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">&nbsp;</div>\n<div class=\"_2cuy _3dgx _2vxa\">Through this process, we formed what Midlands Recovery Center will offer: Peer Support Services and a holistic, abstinence-based recovery approach.</div>\n<h5>&nbsp;</h5>\n<h5>&nbsp;</h5>\n<h5><span style=\"color: #236fa1;\"><strong><em>&ndash; SERVICES AT MIDLANDS RECOVERY CENTER</em></strong></span></h5>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><span style=\"color: #236fa1;\"><em><strong>Peer Support</strong>&nbsp;</em>&ndash;</span></p>\n<p>Individualized one-on -one recovery support, 12-step and other recovery groups.</p>\n<p>&nbsp;</p>\n<p><span style=\"color: #236fa1;\"><em><strong>Tele-Health</strong></em>&nbsp;&ndash;</span></p>\n<p>Telehealth services focused on brief trauma education designed for men&rsquo;s issues.</p>\n<p>&nbsp;</p>\n<p><span style=\"color: #236fa1;\"><em><strong>Intervention</strong></em>&nbsp;&ndash;</span></p>\n<p>We use the ARISE Invitational Intervention Model.</p>\n<p>&nbsp;</p>\n<p><span style=\"color: #236fa1;\"><em><strong>Rehabilitation</strong></em>&nbsp;&ndash;</span></p>\n<p>Probation violation assistance, treatment and sober living placement referrals and relapse prevention support.</p>\n<p>&nbsp;</p>\n<p><span style=\"color: #236fa1;\"><em><strong>Community Education</strong></em>&nbsp;&ndash;</span></p>\n<p>Public speaking engagements, education about opiate and heroin addiction, and personal recovery stories.</p>\n<p>&nbsp;</p>\n<p><span style=\"color: #236fa1;\"><strong>Wellness</strong>&nbsp;&ndash;</span></p>\n<p>Wellness and social activities including yoga, sports, karate,mediation as well as other healthy living and coping skills.</p>\n<hr />\n<div id=\"comp-jqh5zh96\" class=\"txtNew\" data-packed=\"true\">\n<h5 class=\"font_0\"><em><strong><span class=\"color_33\">&nbsp;</span></strong></em></h5>\n<h5 class=\"font_0\"><span style=\"color: #236fa1;\"><em><strong><span class=\"color_33\">&ndash; THE ARISE INVITATIONAL INTERVENTIONS</span></strong></em></span></h5>\n<p>&nbsp;</p>\n<p>ARISE&reg; Comprehensive Care with Invitational Intervention&reg; is</p>\n</div>\n<div id=\"comp-jqh5w1pi\" class=\"txtNew\" data-packed=\"true\">\n<ul>\n<li class=\"font_8\"><span class=\"color_11\">A series of respectful, gentle family meetings provided through a concierge service.</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Focused on individual and family long-term recovery</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Specialized in adolescents, young adults, children, the elderly, and families</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Proven in federal research to be the most successful intervention</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Provided by a national and international network of interventionists.</span>&nbsp;</li>\n</ul>\n<h5 class=\"font_8\">&nbsp;</h5>\n<h5 class=\"font_8\"><span class=\"color_11\" style=\"color: #2dc26b;\">Includes:</span></h5>\n<ul>\n<li class=\"font_8\"><span class=\"color_11\">Personalized case management (intensive or as needed)</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Safe transitions; safe passage; guided, supported transportation</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Coaching in home or out</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Companionship</span></li>\n<li class=\"font_8\"><span class=\"color_11\">Monitoring</span></li>\n</ul>\n<hr /></div>\n<div id=\"comp-jxxj27ia\" class=\"txtNew\" data-packed=\"false\" data-min-height=\"31\">\n<h5 class=\"font_8\"><strong><em><span class=\"wixGuard\"></span></em></strong></h5>\n<h5 class=\"font_8\"><span style=\"color: #236fa1;\"><strong><em>- NOW BOOKING SPEAKING ENGAGEMENTS&nbsp;FOR 2020</em></strong></span></h5>\n</div>\n<p>&nbsp;</p>\n<p>Bobby Brazell is in recovery from heroin addiction and is a Certified Arise Interventionist and Certified Peer Support Specialist. With more&nbsp;than 20 years of active addiction and is passionate about sharing his recovery story and helping others.</p>', 2, 2, NULL, 'www.yss.com', 'zxcvbnm,kjhg', 'https://www.youtube.com/watch?v=eYv0jfxGZis', 'midlands-recovery-center', 'public/uploads/60d2fa507bc25.jpeg', NULL, NULL, '0', '2021-05-20 12:05:49', '2021-08-12 06:43:59', '0.00'),
(6, 58, 'Recovery center', 'Muradnagar, Uttar Pradesh, India', '28.7718326', '77.5074593', NULL, '<h1><span style=\"color: #3598db;\"><strong>WELCOME TO </strong><strong>THE PHOENIX </strong><strong>RECOVERY PROJECT</strong></span></h1>\n<hr />\n<p>&nbsp;</p>\n<p>We created The Phoenix Recovery Project to bridge the gap between detoxification and inpatient residential drug and alcohol treatment to long term recovery.</p>\n<p>We will help anyone find treatment. By creating a structured recovery house we hope to achieve that goal.</p>\n<p>Through our experience we have recognized that recovery is a life long process that requires a daily commitment in order for a profound transformation to occur.</p>\n<p>An intense sober living program like this was missing from Chester County Pennsylvania.</p>\n<p>We saw an opportunity to promote positive change in the community of Phoenixville, PA for the purpose of creating a caring environment for those seeking recovery.</p>\n<hr />\n<h5>&nbsp;</h5>\n<h5><span style=\"color: #3598db;\"><strong>OUR APPROACH</strong></span></h5>\n<p>&nbsp;</p>\n<p>Here at the Phoenix Recovery Project we believe recovery is something attainable for all individuals who keep an open mind.</p>\n<p>That being the case they also have to be willing.</p>\n<p>We created a structured sober living environment because it will enable individuals that are struggling with drug or alcohol addiction to achieve their wildest dreams in recovery.</p>\n<p>By actively participating in our clients lives we have established a unique approach to addiction that leads to long term recovery.</p>\n<p>We understand the importance and the dramatic change a recovery house can have on an individuals life provided that they follow a few simple rules. With this in mind we hope you reach out to us now!</p>\n<hr />\n<h5><span style=\"color: #236fa1;\"><strong>MEET THE TEAM</strong></span></h5>\n<p>&nbsp;</p>\n<p>BRANDT NORTON &ndash; Founder</p>\n<p>Brandt found recovery on April 27th, 2010.</p>\n<p>He has never looked back, and continues to help others on a daily basis.</p>\n<p>He received his Bachelors in Political Science from West Chester University in Chester County.</p>\n<p>&nbsp;</p>\n<p>Brandt spends much of his free time volunteering in his community.</p>\n<p>Brandt has held many different positions in the addiction treatment field from clinical intern to admissions coordinator.</p>\n<p>He has helped thousands of people find treatment due to his passion for recovery.</p>\n<p>PAUL ZANARAS &ndash; Founder &amp; CEO</p>\n<p>Paul was working as an apprentice for the electrical union when he almost gave up hope.</p>\n<p>He found recovery in December of 2012 and as a result he wanted to create a special program.</p>\n<p>It is his belief that people have the best opportunity at recovery because of a strong recovery house.</p>\n<p>&nbsp;</p>\n<hr />\n<h5>&nbsp;</h5>\n<h5><strong>PREMIER ACCOMMODATIONS &amp; SERVICES</strong></h5>\n<p>In recovery a lot of us have found some hard truths. Specifically, that external appearances aren&rsquo;t always inward realities.</p>\n<p>We provide upscale accommodations for our guest in an effort to build their self esteem, and have a comfortable home-like environment that they will appreciate day after day.</p>\n<p>You will not find a better recovery house in Chester County.</p>\n<hr />\n<h5>&nbsp;</h5>\n<h5>&nbsp;</h5>\n<h5><strong>ADMISSIONS&nbsp;PROCESS AT THE PHOENIX RECOVERY PROJECT</strong></h5>\n<p>The Phoenix Recovery Project located in Chester County will only accept potential residents who are discharging from an detoxification or inpatient residential drug and alcohol facility.</p>\n<p>With this in mind clients who come in contact with us will be referred to appropriate provider.</p>\n<p>Based on their need a person will be placed in treatment as a result of our assessment.</p>\n<p>For this reason they will be more stable, and can be re-evaluated for admission once they complete rehab.</p>\n<p>Residents can find long term recovery as a result of a great recovery house.</p>\n<hr />\n<h5>&nbsp;</h5>\n<h5><strong>THE PROCESS</strong></h5>\n<p>Residents will complete an in-person interview or thorough phone screen is required to due to the determination if the patient is a good fit for the recovery house services.</p>\n<p>&nbsp;</p>\n<p>On the whole we want to create a loving &amp; caring environment that is very structured.</p>\n<p>&nbsp;</p>\n<p>We understand that our way is not the right path for everyone as a result we want to sure ensure our residents have the best shot at recovery.</p>\n<p>&nbsp;</p>\n<p>If approved we will also request medical records/medication lists from the referring inpatient treatment provider due to the fact that not everyone is appropriate for our house.</p>\n<hr />\n<h5>&nbsp;</h5>\n<h5><strong>WHAT HAPPENS NEXT</strong></h5>\n<p>A Phoenix Recovery Project staff member or the drug and alcohol treatment provider will provide the transportation as result of approval.</p>\n<p>&nbsp;</p>\n<p>We prefer it to be a door to door transfer as a smooth transition from inpatient to a recovery house for the simple reason that it is crucial to resident&rsquo;s successful acclamation to our sober living house.</p>\n<p>&nbsp;</p>\n<p>Patients should not return home before arriving as it could result in relapse. A new resident will be welcomed by staff, and be oriented to the house/rules accordingly.</p>\n<hr />\n<h5>&nbsp;</h5>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', 2, 2, NULL, 'www.yss.com', NULL, NULL, 'recovery-center', 'uploads/60a64b07b5053.jpeg', NULL, NULL, '0', '2021-05-20 12:41:59', '2021-08-12 06:44:04', '0.00'),
(11, 63, 'dietition', 'GD Colony, Block A, Mayur Vihar Phase III, Delhi, India', '28.6134313', '77.3317246', 'counsellor@yopmail.com', '<h1><strong>Welcome to The Recovery Concierge</strong></h1>\r\n\r\n<hr />\r\n<h5><strong>Transforming Lives, Families, and Communities</strong></h5>\r\n\r\n<p>The Recovery Concierge can help you build the life you dream of so you can thrive &ndash; not just survive &ndash; in sobriety.&nbsp;The &ldquo;one-size-fits-all&rdquo; approach to addiction and chemical dependency treatment often misses the mark.&nbsp;It fails to address you as a whole person, and it&rsquo;s often equated with the absence of fun, sacrifice, and fear-based tactics that make a life of sobriety seem like a constant battle.</p>\r\n\r\n<p>Sustainable change is possible in recovery, and I help individuals and families achieve this change in order to bring about true fulfillment, peace, and happiness.</p>\r\n\r\n<p>Helping you build a unique, custom-based clinical wellness and recovery plan, The Recovery Concierge enables you to reintegrate back into your life and community with the resources, strategies, and support for continued success.</p>\r\n\r\n<p>I take into consideration your physical, mental, and emotional needs in order to create a holistic recovery action plan. Armed with a clear personal mission and an understanding of what&rsquo;s holding you back from true transformation, I customize a road-map for you to accomplish this &ndash; and to reach your highest potential.</p>\r\n\r\n<h5><strong>About Jeanne Foot</strong></h5>\r\n\r\n<p>I&rsquo;m Jeanne, mental health advocate and certified addiction counsellor and recovery specialist, with over a decade serving individuals and families in the Toronto area, across the globe, and online.</p>\r\n\r\n<p>My own struggles with the nature of addiction and years spent navigating the mental health care system as an advocate for my child has enabled me to become a change agent and a mentor in transformation for others.</p>\r\n\r\n<p>Witnessing gaps in the system and how a one-size-fits-all approach to recovery fails too many people, I became passionate about synthesizing information &ndash; and clearing up the misinformation &ndash; about how individuals can achieve sustainable recovery, regardless of the approach they take.</p>\r\n\r\n<p>I created The Recovery Concierge because I saw that not all recovery services are timely, efficient, or effective at producing long-term, sustainable change.</p>\r\n\r\n<p>With a strong pulse on the industry and a tenacious, yet spirited, approach, I am passionate about treating chemical dependency and addiction as any other illness and empowering long-term transformation in my clients.</p>\r\n\r\n<h5><strong>Professional Certifications</strong></h5>\r\n\r\n<ul>\r\n	<li>Canadian Certified Addiction Counsellor (C.C.A.C.)</li>\r\n	<li>Certified SMART Recovery Facilitator</li>\r\n	<li>Member of the&nbsp;<strong><a href=\"http://www.ccdus.ca/Eng/Pages/default.aspx\" rel=\"noopener noreferrer\" target=\"_blank\">Canada Centre for Substance Abuse</a></strong></li>\r\n	<li>Graduate of Addiction Care Work Program from McMaster University</li>\r\n	<li>Certificates of Completion for SASSI substance screening in:<br />\r\n	&bull; Clinical Interpretation for Addiction Screening &amp; Assessments<br />\r\n	&bull; Administration &amp; Scoring for Addiction Screening and Assessments</li>\r\n</ul>\r\n\r\n<p>My other professional credentials include:</p>\r\n\r\n<p>Driven by my personal passion for mental health issues, I was one of the founding members and became instrumental in building the Family Navigation Project at&nbsp;<em><strong><a href=\"https://sunnybrook.ca/\" rel=\"noopener noreferrer\" target=\"_blank\">Sunnybrook&nbsp;Health Sciences</a></strong></em>&nbsp;&ndash; where I served as the past the Chair of the Family Advisory Council.</p>', 2, 2, NULL, 'www.yss.com', '9876553412', 'https://youtu.be/qUN3mW5OpRA', 'dietition', 'uploads/60a73cce0bd7d.jpeg', NULL, NULL, '0', '2021-05-21 05:53:34', '2021-08-12 06:44:21', '0.00'),
