book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\n</div>\n<div>\n<h2>Why do we use it?</h2>\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\n</div>\n<br />\n<div>\n<h2>Where does it come from?</h2>\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p>\n<p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>\n</div>\n<div>\n<h2>Where can I get some?</h2>\n<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p>\n<form action=\"https://www.lipsum.com/feed/html\" method=\"post\">\n<table>\n<tbody>\n<tr>\n<td rowspan=\"2\"><input id=\"amount\" name=\"amount\" size=\"3\" type=\"text\" value=\"5\" /></td>\n<td rowspan=\"2\">\n<table>\n<tbody>\n<tr>\n<td><input id=\"paras\" checked=\"checked\" name=\"what\" type=\"radio\" value=\"paras\" /></td>\n<td><label for=\"paras\">paragraphs</label></td>\n</tr>\n<tr>\n<td><input id=\"words\" name=\"what\" type=\"radio\" value=\"words\" /></td>\n<td><label for=\"words\">words</label></td>\n</tr>\n<tr>\n<td><input id=\"bytes\" name=\"what\" type=\"radio\" value=\"bytes\" /></td>\n<td><label for=\"bytes\">bytes</label></td>\n</tr>\n<tr>\n<td><input id=\"lists\" name=\"what\" type=\"radio\" value=\"lists\" /></td>\n<td><label for=\"lists\">lists</label></td>\n</tr>\n</tbody>\n</table>\n</td>\n<td><input id=\"start\" checked=\"checked\" name=\"start\" type=\"checkbox\" value=\"yes\" /></td>\n<td><label for=\"start\">Start with \'Lorem<br />ipsum dolor sit amet...\'</label></td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td><input id=\"generate\" name=\"generate\" type=\"submit\" value=\"Generate Lorem Ipsum\" /></td>\n</tr>\n</tbody>\n</table>\n</form></div>\n</div>\n<hr />\n<div class=\"boxed\"><strong>Translations:</strong>&nbsp;Can you help translate this site into a foreign language ? Please email us with details if you can help.</div>\n<hr />\n<div class=\"boxed\">There are now a set of mock banners available&nbsp;<a class=\"lnk\" href=\"https://www.lipsum.com/banners\">here</a>&nbsp;in three colours and in a range of standard banner sizes:</div>\n<hr />\n<div class=\"boxed\"><strong>Donate:</strong>&nbsp;If you use this site regularly and would like to help keep the site on the Internet, please consider donating a small sum to help pay for the hosting and bandwidth bill. There is no minimum donation, any sum is appreciated - click&nbsp;<a class=\"lnk\" href=\"https://www.lipsum.com/donate\" target=\"_blank\" rel=\"noopener\">here</a>&nbsp;to donate using PayPal. Thank you for your support.</div>\n<div class=\"boxed\"><strong>Donate Bitcoin:</strong>&nbsp;16UQLq1HZ3CNwhvgrarV6pMoA2CDjb4tyF</div>\n<hr />\n<div id=\"Packages\" class=\"boxed\"><a href=\"https://github.com/traviskaufman/node-lipsum\" target=\"_blank\" rel=\"noopener\">NodeJS</a>&nbsp;<a href=\"http://code.google.com/p/pypsum/\" target=\"_blank\" rel=\"noopener\">Python Interface</a>&nbsp;<a href=\"http://gtklipsum.sourceforge.net/\" target=\"_blank\" rel=\"noopener\">GTK Lipsum</a>&nbsp;<a href=\"http://github.com/gsavage/lorem_ipsum/tree/master\" target=\"_blank\" rel=\"noopener\">Rails</a>&nbsp;<a href=\"https://github.com/cerkit/LoremIpsum/\" target=\"_blank\" rel=\"noopener\">.NET</a>&nbsp;<a href=\"http://groovyconsole.appspot.com/script/64002\" target=\"_blank\" rel=\"noopener\">Groovy</a></div>\n</div>', 2, 2, NULL, 'https://www.lipsum.com/', NULL, NULL, 'listing-by-david', 'public/uploads/60ac7748a1afc.jpeg', NULL, NULL, '0', '2021-05-25 05:04:24', '2021-08-12 06:46:21', '0.00');
