(28, 85, 'Sober Living Los Angeles', 'Muradnagar, Uttar Pradesh, India', '28.7718326', '77.5074593', 'counsellor1@gmail.com', '<h1>Sober Living Los Angeles &ndash;&nbsp;NUVU Sober Living</h1>\r\n\r\n<hr />\r\n<h3>Welcome to NuVu Women&rsquo;s Sober Living House</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NuVu Sober Living is a structured women&rsquo;s sober living House in Los Angeles, California. Located in Mar Vista, our West Los Angeles location is 1 block from Venice Blvd and offers easy access to 12 step meetings, gyms, beaches, West Los Angeles campuses as well as many other of the resources and attractions that this convenient coastal location offers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<h3>Our Goal</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our goal is to assist our guests in long term recovery and to provide an environment that promotes responsibility, abstinence, and personal growth. We are committed to providing you with a safe, comfortable, and supportive, sober environment that you are happy to call home.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<h3>12 Step</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We believe in a 12 step based approach to recovery and encourage all of our guests to be actively involved in achieving personal growth while maintaining or seeking employment and/or education. We wish to create an environment that builds a sense of home, community, and support, that will serve to build confidence to achieve your goals in and outside of the home.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If NuVu Sober Living House sounds like the right fit for you contact our house manager to set up an appointment to come by and see us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<h3>Women&rsquo;s Sober Living Los Angeles</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NuVu Sober Living House is a 4 bedroom Women&rsquo;s sober living house located in Mar Vista on the West Side of Los Angeles. Our West LA location is 1 block from Venice Blvd and offers easy access to 12 step meetings, gyms, beaches, West Los Angeles campuses as well as many other of the resources and attractions that this convenient costal location offers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our goal is to assist our guests in long term recovery and to provide an environment that promotes responsibility, abstinence, and personal growth. We are committed to providing you with a safe, comfortable, supportive, and sober environment that you are happy to call home.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We believe in a 12 step based approach to recovery and encourage all of our guests to be actively involved in achieving personal growth while maintaining or seeking employment and/or education. We wish to create an environment that builds a sense of home, community, and support that will serve to build confidence to achieve your goals in and outside of the home.</p>', 1, 2, NULL, 'www.yss.com', '9876553412', 'https://youtu.be/OwW8x_0YGLI', 'sober-living-los-angeles', 'public/uploads/60ac8249b31ed.jpg', NULL, NULL, '0', '2021-05-25 05:51:21', '2021-08-12 06:46:16', '0.00'),
(29, 87, 'Recovery homes', 'Noida-Greater Noida Expressway, 3C Lotus Zing, Sector 107, Noida, Uttar Pradesh, India', '28.49787', '77.4113462', 'test@gmail.com', '<h1><strong>Welcome Home</strong></h1>\n<hr />\n<p>&nbsp;</p>\n<p>Steps to Recovery Homes is located in Cottonwood Arizona which is the heart of the Beautiful Verde Valley.</p>\n<p>Our long term goal here at Steps to Recovery Homes is to create a healthy, safe and structured environment for our clients. Also, to help our community by giving people an opportunity to become productive members of society and lower the recidivism rates in the community.</p>\n<p>Steps to Recovery Homes is a viable placement for those who are serious about changing their lives.</p>\n<p>Steps to Recovery Homes was formed by Anne and Damien Browning.</p>\n<p>We have both been through hardships and have changed our lives, becoming assets to our community and our families.</p>\n<h5>&nbsp;</h5>\n<h4><strong>We Have a Vision</strong></h4>\n<h4>&nbsp;</h4>\n<p>The decision to open this business did not come lightly, It was one that came straight from our hearts. Our purpose is to always build healthy relationships with the public and work in cooperation with others.</p>\n<p>Together we have a vision of helping our clients to help not only themselves, but also to learn how they can help others.</p>\n<p>We believe the assistance that we offer to our clients will be beneficial to them.</p>\n<p>By setting an example, providing direction, and working on behaviors; we know that our clients can become assets to their families. They can also become responsible, accountable and find integrity in their own lives and in the eyes of the community.</p>\n<p>&nbsp;</p>\n<h4><strong>We Understand &amp; Believe</strong></h4>\n<p>&nbsp;</p>\n<h4>We believe that people really do want to change, but are lacking the guidance and environment to do so. We provide that environment.</h4>\n<p>We know from our own experiences that total recovery is possible, and know we will be able to help.</p>\n<p>We are passionate about helping others recover from alcohol and drug addiction.</p>\n<p>We offer a holistic look at substance abuse and compile all factors into a recovery program that focuses on all aspects of life not just on the alcohol abuse, heroin addiction, cocaine or crystal meth addiction.</p>\n<p>This way has been proven to maximize the success rate of individuals with a substance use disorder.</p>\n<p>&nbsp;</p>\n<h4><strong>Long Term Recovery And a Successful Life</strong></h4>\n<p>&nbsp;</p>\n<h4>Our graduates of Steps to Recovery Homes have a real chance at long term recovery and a successful life.</h4>\n<p>We are not just a sober living home. We provide real recovery homes that are safe, structured, and clean along with an example driven behavior modification program that actually provides the life skills that people desperately need to be able to be a productive member of their families and society.</p>\n<p>We are within blocks to a drug counseling program that collaborates with our mission.</p>\n<p>Our program is an excellent way to continue to build your foundation after going through drug rehabilitation program, behavioral health center, or a detoxification program.</p>\n<p>&nbsp;</p>\n<h4><strong>A Solid Recovery Plan</strong></h4>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>We believe a solid recovery plan and some real guidance can enable you to stop self-destructing and start living a productive and happy life.</p>\n<p>Steps to Recovery Homes provides Life Coaching sessions in areas of our life that have usually been significantly affected by drug addiction and/or the abuse of alcohol.</p>\n<p>Some of these areas are; finances, relationships, personal boundaries, obtaining and securing long term employment, communication, health and hygiene, parenting and many more.</p>', 1, 1, NULL, 'www.yss.com', '9582593986', 'https://youtu.be/OwW8x_0YGLI', 'recovery-homes', 'public/uploads/60acdb47865cc.jpg', NULL, NULL, '0', '2021-05-25 07:34:28', '2021-10-06 20:01:52', '0.00'),
(30, 88, 'Oaks Recovery Center', 'Noida Sector 18, Noida, Uttar Pradesh, India', '28.5729847', '77.32490430000001', 'test@youpmail.com', '<h1><strong>Oaks Recovery Center &ndash; Rooted in Recovery</strong></h1>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Oaks Recovery Center is an addiction rehab facility based in Greenwood, South Carolina.</p>\r\n\r\n<p>We offer short-term and long-term programs to men who want freedom from addiction. Residents are patiently guided to recovery in home-like facilities.</p>\r\n\r\n<h5><strong>The Twelve Steps to Recovery</strong></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Oaks Recovery Center exclusively follows the Twelve Step program, with no modifications or adaptations.</p>\r\n\r\n<p>This program is built on extensive experience and proven through many years of use.</p>\r\n\r\n<p>Although each person&rsquo;s journey through the steps is different, we believe that the full journey, when completed, is an effective path to recovery.</p>\r\n\r\n<p>Our staff leverages their experience with addiction and recovery to help our residents, but only within the twelve steps.</p>\r\n\r\n<p>We believe that unproven opinions have the power to kill.</p>\r\n\r\n<p>Addiction is not just a bad habit that can be stopped through willpower.</p>\r\n\r\n<p>It is a disease that pervasively invades a life. To find true recovery, an addict must deal with the root of the disease.</p>\r\n\r\n<p>Through the Twelve Steps, we recognize the truth of addiction. Then we work together toward repairing the damage it has caused.</p>\r\n\r\n<h5><strong>You Can Find Recovery</strong></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>We believe that no one should suffer the hopelessness of addiction.</p>\r\n\r\n<p>Founded in 2015, our program helps addicted men from all over the United States find real recovery.</p>\r\n\r\n<p>Regardless of your condition, we can find a way to help you.</p>\r\n\r\n<p>Although our facility doesn&rsquo;t offer on-site help for every issue, someone in our vast network will always be able to provide the assistance you need.</p>\r\n\r\n<p>Together, we will overcome addiction one life at a time.</p>\r\n\r\n<p>Any person can find recovery.</p>\r\n\r\n<p>No matter what gender, race, religion, amount of education, or history, you can find recovery.</p>\r\n\r\n<h5><strong>We Are Recovered People Reaching People</strong></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Our staff is almost entirely recovered alcoholics or addicts.</p>\r\n\r\n<p>They understand the painful grip of addiction and the tough road to recovery. Their personal experiences uniquely gift them to help people to recovery.</p>\r\n\r\n<p>For our staff members, this isn&rsquo;t just a job&mdash;it&rsquo;s a life or death passion.</p>\r\n\r\n<p>They&rsquo;ve chosen this team and our residents as their family. Let them help you recover.</p>\r\n\r\n<h5><strong>Mission Statement</strong></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>We are dedicated to providing individuals, families, and communities with evidence-based, proven practices to overcome &amp; prevent addiction to alcohol and other drugs in a safe environment.</p>\r\n\r\n<h5><strong>Vision Statement &ndash; United, we will overcome addiction one life at a time!</strong></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><strong>Our Core Values</strong></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Provide consistent quality care</li>\r\n	<li>Create a strong team and family-like environment</li>\r\n	<li>Continually grow personally and professionally</li>\r\n	<li>Build business on integrity, compassion, and relationships</li>\r\n	<li>Offer affordable and successful services led by those in recovery</li>\r\n</ul>\r\n\r\n<h5><strong>Programs at Oaks Recovery Center</strong></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<h5>&nbsp;</h5>\r\n\r\n<h5><strong>Long-Term Program</strong></h5>\r\n\r\n<p>Our long-term vocational program (minimum commitment: 4 months) combines deep study of the Twelve Steps of Recovery with vocational training and employment opportunities.</p>\r\n\r\n<p>Residents leave the program with the tools they need to return home with purpose.</p>\r\n\r\n<p>This program includes instruction in r&eacute;sum&eacute; writing, application completion, and interviewing. Transportation is provided.</p>\r\n\r\n<p>We have strong relationships with the very supportive Greenwood community and 97% of our residents are able to find employment.</p>\r\n\r\n<p>This program is not designed to begin a career. But it will teach necessary job skills, provide purpose through the recovery process, and ease the burden of expenses.</p>\r\n\r\n<p>However, we never allow vocational rehabilitation to overshadow the recovery process.</p>\r\n\r\n<p>Each resident is properly guided through the early steps before beginning a job search.</p>\r\n\r\n<p><a href=\"https://oaksrecovery.org/programs/long-term-program/\" rel=\"noopener noreferrer\" target=\"_blank\">More Info&nbsp;</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<h5>&nbsp;</h5>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h5><strong>Short-term Program</strong></h5>\r\n\r\n<p>The short-term program is an intensive approach to recovery through the Twelve Steps outlined in the Big Book of Alcoholics Anonymous. Participants experience the curriculum through group meetings, workshops, small group discussions, and one on one counseling.</p>\r\n\r\n<p>They are guided by professional staff, many of whom have personal experience with addiction.</p>\r\n\r\n<p>The short-term minimum commitment is 28 days. Our program participants are encouraged to stay until they have fully mastered the steps.</p>\r\n\r\n<p>Recovery doesn&rsquo;t happen on a perfect timetable, so we patiently work through the steps at each person&rsquo;s pace.</p>', 2, 1, NULL, 'https://connect.yoursafespaceonline.com', '9582593986', 'https://youtu.be/eYv0jfxGZis', 'oaks-recovery-center', 'public/uploads/60acb8416e505.jpg', NULL, NULL, '0', '2021-05-25 07:40:02', '2021-10-06 20:01:52', '0.00'),
(32, 93, 'demo123', 'Noida Sector 59 Metro Station, Vishwakarma Road, D Block, Sector 59, Noida, Uttar Pradesh, India', '28.607693', '77.37270269999999', NULL, '<p>test</p>\n<p>&nbsp;</p>\n<p>test</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>test</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>test</p>', 2, 2, NULL, 'test.com', NULL, NULL, 'demo123', 'public/uploads/60b066ba55966.jpeg', NULL, NULL, '0', '2021-05-28 04:42:50', '2021-10-06 20:01:52', '0.00'),
(33, 96, 'your safe space', 'London, UK', '51.5073509', '-0.1277583', NULL, '<h2><em><strong>WELCOME TO THE BECKLEY HOUSE</strong></em></h2>\r\n\r\n<h2><em><strong>RECOVERY RESIDENCE FOR MEN</strong></em></h2>\r\n\r\n<hr />\r\n<p>The Beckley House Recovery residence is a 12 Step&nbsp;<strong><em>&ldquo;Adventure Based&rdquo;</em></strong>&nbsp;sober living home for men that are 18 years and older, located in Canaan, CT.</p>\r\n\r\n<p>Our program is specifically designed to offer men with drug addiction, alcoholism and substance abuse disorder an opportunity to build a strong program of recovery while living and enjoying life with like minded fellows.</p>\r\n\r\n<h3><em><strong>THE BECKLEY HOUSE MISSION</strong></em></h3>\r\n\r\n<p>Our mission is to provide a supportive and fun environment for men seeking to recover from a seemingly hopeless state of mind and body.</p>\r\n\r\n<p>Our program focuses on responsibility, accountability, honor, compassion, 12 Step recovery programs, service and fun for our residents.</p>\r\n\r\n<h3><em><strong>SOBER LIVING IN THE BERKSHIRES</strong></em></h3>\r\n\r\n<p>The Beckley House is a grand old Victorian Estate and Carriage House located in the heart of the&nbsp;<strong><a href=\"https://berkshires.org/\" rel=\"noopener\" target=\"_blank\">Berkshires</a>.</strong>&nbsp;For over 80 years, the Berkshires area has been known as New England&rsquo;s premier summer spot for culture-driven travel.&nbsp;</p>\r\n\r\n<p>Each resident resides in a fully furnished apartment with two or three fellow residents.</p>\r\n\r\n<p>Living in the Berkshires we are graced with the&nbsp;<strong><a href=\"https://berkshires.org/wp-content/uploads/2018/09/Guide_2018.pdf\" rel=\"noopener\" target=\"_blank\">possibility of many adventures</a>.</strong></p>\r\n\r\n<p>Within 30 miles of the house there are two ski areas, fantastic white water rapids, several beautiful waterfalls, numerous hiking trails and great fishing and swimming.</p>\r\n\r\n<p>Our back yard opens up to a volleyball court, a fire pit and the trail to a ridge with sweeping cliff top views.</p>\r\n\r\n<p>The YMCA, a public golf course and basketball courts are a short walk away. It is truly an amazing environment to start a new life.</p>\r\n\r\n<h3><em><strong>STRUCTURE AND ACCOUNTABILITY</strong></em></h3>\r\n\r\n<h5><em><strong>PHASE 1</strong></em></h5>\r\n\r\n<p>All men are taken to two 12 Step meetings a day by our dedicated &ldquo;<strong><em>Peer Leadership Cadre&rdquo;</em></strong>.</p>\r\n\r\n<p>These leaders support them in acquiring a sponsor and a home group and introduce them to the local community and life at Beckley. They are to be seeking employment and following all house guidelines.</p>\r\n\r\n<p>They are also to be involved with all house activities. The management team will monitor each man&rsquo;s progress on a daily basis.</p>\r\n\r\n<h5><em><strong>PHASE 2</strong></em></h5>\r\n\r\n<p>Our residents are working, attending school or volunteering a minimum of 30 hours per week.</p>\r\n\r\n<p>They attend 12 Step meetings, have obtained a sponsor and home group and begun working the 12 Step Program of Recovery.</p>\r\n\r\n<p>Regular participation in house service and adventure activities is required for consideration for leadership positions.</p>\r\n\r\n<h5><em><strong>PHASE 3</strong></em></h5>\r\n\r\n<p>Phase III is a Leadership program. These residents hold service commitments in the House.</p>\r\n\r\n<p>They have the responsibility to mentor newer residents while maintaining their own recovery and guided development.</p>\r\n\r\n<p>They also get reduced rent so they can save up for when they are ready to move on into their lives after Beckley.</p>\r\n\r\n<h3><em><strong>ACTIVITIES AT THE BECKLEY HOUSE</strong></em></h3>\r\n\r\n<p>The Beckley House provides group activities such as hikes, paintball, bowling, whitewater rafting, skiing, sweat lodges, volleyball etc.</p>\r\n\r\n<p>These activities are part of the glue that binds us together as a family.</p>\r\n\r\n<p>As giving back is an important part of the overall program, we also do volunteer work with<strong>&nbsp;<a href=\"https://www.habitat.org/\" rel=\"noopener\" target=\"_blank\">Habitat For Humanity</a></strong>&nbsp;and other local organizations and individuals throughout the year.</p>\r\n\r\n<h3><strong><em>RECOVERY CASE&nbsp;</em><em>MANAGEMENT</em></strong></h3>\r\n\r\n<p>Once a week all residents meet with the director or other appointed leadership staff to discuss their individual recovery goals, progress and plans, including 12 Step work, employment, education and day to day challenges.</p>', 14, 3, NULL, 'www.yss.com', '9786543282', 'https://youtu.be/sac_i0lzZ9g', 'your-safe-space', 'public/uploads/60b4baa6ee9cc.jpeg', NULL, NULL, '0', '2021-05-31 11:29:58', '2021-10-06 20:01:52', '0.00'),
