(38, 121, 'therapy', 'London, UK', '51.5073509', '-0.1277583', NULL, '<h2><strong>Welcome to Landmark Recovery</strong></h2>\n<p>Landmark Recovery of Oklahoma City offers a variety of treatment programs to meet the individual needs of our patients.</p>\n<p>From residential inpatient treatment to medical detoxification, partial hospitalization, and intensive outpatient programs, our curriculum is all-encompassing and directed at addressing addiction from all angles.</p>\n<p>This includes access to industry leading medications for the treatment of withdrawal symptoms, group and individual therapy sessions lead by master&rsquo;s level clinicians, and extensive family counseling and follow-up support.</p>\n<h3><strong>Inpatient Treatment</strong></h3>\n<p>Inpatient treatment at Landmark Recovery of Oklahoma City comprises full time residency of 30-45 days with the goal of stabilizing and improving the life functionality of patients following withdrawal from alcohol, opiates, sedatives, or other mind altering substances.</p>\n<h3><strong>A Network of Support</strong></h3>\n<p>Our program is centered around teaching patients skills to maintain sobriety, with therapy sessions designed to explore the underlying triggers of substance abuse, and support groups designed to help recovering addicts share their story in a safe, private environment.</p>\n<p>Here the patient can build a network of support and skills that lasts well beyond our doors.</p>\n<h3><strong>The Landmark Mission</strong></h3>\n<p>Landmark Recovery exists to assist each patient in the development of a lifestyle that is permanently free from all mind and mood altering substances and that promotes the patient&rsquo;s well-being across mind, body, and spirit.</p>\n<p>We strive to achieve this vision by building strong, ethically-grounded relationships between each employee and each patient.</p>\n<p>These relationships outlast the treatment program and continue to serve the patient as long as necessary post-discharge.</p>\n<h3><strong>Our Vision</strong></h3>\n<ul>\n<li>We will be thought leaders, driven by our data to make continual improvements to the services we offer.</li>\n<li>We will eliminate unsupported relapse among our patients within 5 years of treatment.</li>\n<li>We will ensure no American has to travel more than 2 hours to receive effective, high-quality treatment for addiction disorders.</li>\n<li>Through our work, we will restore hope, tranquillity, and function to one million families over the next one hundred years.</li>\n</ul>\n<h3><strong>Families Recover at Landmark</strong></h3>\n<p>At Landmark Recovery, we believe successful treatment impacts not only the patient, but also the patient&rsquo;s entire family.</p>\n<p>As such, we offer complimentary therapy groups twice per week to help address the impact of addiction on loved ones.</p>\n<h3><strong>Family Group</strong></h3>\n<p>Topics covered during family group include:</p>\n<ul>\n<li>How &ldquo;We&rdquo; are affected by the loved one&rsquo;s addiction</li>\n<li>How to process feelings of hurt and confusion that accompany living with someone actively using substances.</li>\n<li>Setting healthy boundaries</li>\n<li>Developing a new set of beliefs, values and rules</li>\n<li>How to distinguish between supporting a loved one and enabling them. Family members learn that, while done with the best of intentions, enabling ultimately can leave the addict confused, angry and hurt.</li>\n<li>Our workshop helps instil more confidence and knowledge to recognize unhealthy behaviors and draw appropriate boundaries.</li>\n</ul>\n<h3><strong>Support Groups for Family</strong></h3>\n<p>Introduction to support groups for family members and loved ones, such as Al-Anon, Nar-Anon, and Families Anonymous.</p>\n<p>Landmark even hosts an Al-Anon meeting on campus once per week on Saturdays so families can get plugged into a community prior to the loved one leaving treatment.</p>\n<p>We understand that learning to live free from the chaos of active addiction takes time. Within the family program you&rsquo;ll find helpful information you can use and apply.</p>\n<p>Our goal is to make the lessons learned in our family portion usable and understandable.</p>\n<p>In addition, at least one individual therapy session during treatment is dedicated to involving the family and processing the disease of addiction together.</p>\n<p>Additional sessions are held as needed in order to restore healthy familial relationships.</p>\n<p>Our staff include Licensed Marriage and Family therapists who specialize in navigating how addiction impacts families and working to improve those relationships, to help establish healthy roads to recovery for the patient post discharge.</p>\n<h3><strong>Services and Care</strong></h3>\n<ul>\n<li>Medical Detox</li>\n<li>Residential Treatment</li>\n<li>Partial Hospitalization</li>\n<li>Intensive Outpatient</li>\n<li>Individual &amp; Group Therapy</li>\n<li>Mindfulness &amp; Recreation</li>\n<li>Alumni Program</li>\n<li>SMART Recovery</li>\n<li>What Is Vivitrol?</li>\n</ul>', 2, 2, NULL, 'www.YSScom', NULL, 'https://youtu.be/uWGTciX795o', 'therapy', 'public/uploads/60d1a3583e2d3.jpeg', NULL, NULL, '0', '2021-06-22 09:46:16', '2021-10-19 17:42:18', '0.00'),
