(45, 150, 'counsellor by admin', 'Muradnagar, Uttar Pradesh, India', '28.7718326', '77.5074593', NULL, '<h3><em><strong>THE BECKLEY HOUSE MISSION</strong></em></h3>\r\n\r\n<p>Our mission is to provide a supportive and fun environment for men seeking to recover from a seemingly hopeless state of mind and body.</p>\r\n\r\n<p>Our program focuses on responsibility, accountability, honor, compassion, 12 Step recovery programs, service and fun for our residents.</p>\r\n\r\n<h3><em><strong>SOBER LIVING IN THE BERKSHIRES</strong></em></h3>\r\n\r\n<p>The Beckley House is a grand old Victorian Estate and Carriage House located in the heart of the&nbsp;<strong><a href=\"https://berkshires.org/\" rel=\"noopener\" target=\"_blank\">Berkshires</a>.</strong>&nbsp;For over 80 years, the Berkshires area has been known as New England&rsquo;s premier summer spot for culture-driven travel.&nbsp;</p>\r\n\r\n<p>Each resident resides in a fully furnished apartment with two or three fellow residents.</p>\r\n\r\n<p>Living in the Berkshires we are graced with the&nbsp;<strong><a href=\"https://berkshires.org/wp-content/uploads/2018/09/Guide_2018.pdf\" rel=\"noopener\" target=\"_blank\">possibility of many adventures</a>.</strong></p>\r\n\r\n<p>Within 30 miles of the house there are two ski areas, fantastic white water rapids, several beautiful waterfalls, numerous hiking trails and great fishing and swimming.</p>\r\n\r\n<p>Our back yard opens up to a volleyball court, a fire pit and the trail to a ridge with sweeping cliff top views.</p>\r\n\r\n<p>The YMCA, a public golf course and basketball courts are a short walk away. It is truly an amazing environment to start a new life.</p>\r\n\r\n<h3><em><strong>STRUCTURE AND ACCOUNTABILITY</strong></em></h3>\r\n\r\n<h5><em><strong>PHASE 1</strong></em></h5>\r\n\r\n<p>All men are taken to two 12 Step meetings a day by our dedicated &ldquo;<strong><em>Peer Leadership Cadre&rdquo;</em></strong>.</p>\r\n\r\n<p>These leaders support them in acquiring a sponsor and a home group and introduce them to the local community and life at Beckley. They are to be seeking employment and following all house guidelines.</p>\r\n\r\n<p>They are also to be involved with all house activities. The management team will monitor each man&rsquo;s progress on a daily basis.</p>\r\n\r\n<h5><em><strong>PHASE 2</strong></em></h5>\r\n\r\n<p>Our residents are working, attending school or volunteering a minimum of 30 hours per week.</p>\r\n\r\n<p>They attend 12 Step meetings, have obtained a sponsor and home group and begun working the 12 Step Program of Recovery.</p>\r\n\r\n<p>Regular participation in house service and adventure activities is required for consideration for leadership positions.</p>\r\n\r\n<h5><em><strong>PHASE 3</strong></em></h5>\r\n\r\n<p>Phase III is a Leadership program. These residents hold service commitments in the House.</p>\r\n\r\n<p>They have the responsibility to mentor newer residents while maintaining their own recovery and guided development.</p>\r\n\r\n<p>They also get reduced rent so they can save up for when they are ready to move on into their lives after Beckley.</p>\r\n\r\n<h3><em><strong>ACTIVITIES AT THE BECKLEY HOUSE</strong></em></h3>', 2, 2, NULL, 'https://www.yss.com', '1234567890', NULL, 'counsellor-by-admin', 'public/uploads/60dd55ea38cec.jpg', NULL, NULL, '0', '2021-07-01 06:43:06', '2021-10-19 17:42:18', '0.00'),
