(98, 312, 'Fortis Clinic', 'Fortis Hospital, Sector 62, Noida, Block B, D Block, Sector 62, Noida, Uttar Pradesh, India', '28.6187084', '77.37258349999999', NULL, '<p>Fortis Healthcare Limited &ndash; an IHH Healthcare Berhad Company &ndash; is a leading integrated healthcare services provider in India. It is one of the largest healthcare organisations in the country with 36 healthcare facilities (including projects under development), 4000 operational beds and over 400 diagnostics centres (including JVs). Fortis is present in India, United Arab Emirates (UAE) &amp; Sri Lanka. The Company is listed on the BSE Ltd and National Stock Exchange (NSE) of India. It draws strength from its partnership with global major and parent company, IHH, to build upon its culture of world-class patient care and superlative clinical excellence. Fortis employs 23,000 people (including SRL) who share its vision of becoming the world&rsquo;s most trusted healthcare network. Fortis offers a full spectrum of integrated healthcare services ranging from clinics to quaternary care facilities and a wide range of ancillary services.</p>', 14, 3, NULL, NULL, NULL, NULL, 'fortis-clinic', 'public/uploads/6180fdca26ce1.jpeg', NULL, NULL, '0', '2021-11-02 08:58:50', '2021-11-02 08:58:50', '0.00'),
