(1020, 1, 48, 'Associate Consultant - Development', 'Encouragement: A coach will always hold that their client is naturally resourceful and whole; that they have within them the ability to do what they need to do, to achieve what they want to achieve.\r\nContinuing Skills: A coach can help the individual see how they can transfer their skills that have enabled their survival until now, into skills for life in recovery.\r\nEmpowerment: A coach will help their client to appreciate where they have done well, and what their strengths are, to empower them in their recovery.', '0', '2021-06-28 15:34:56', '2021-06-28 11:04:56'),
