(30, 88, '01', 'Covaxin', 'Covaxin is an inactivated vaccine which means that it is made up of killed coronaviruses, making it safe to be injected into the body.\n\nBharat Biotech, a 24-year-old vaccine maker with a portfolio of 16 vaccines and exports to 123 countries, used a sample of the coronavirus, isolated by India\'s National Institute of Virology.', '15', '00', '500.00', NULL, '2021-05-25 10:42:19', '2021-05-25 10:42:19'),
(31, 88, '05', 'Sputnik V', 'The vaccine, developed by Moscow\'s Gamaleya Institute, initially generated some controversy after being rolled out before the final trial data had been released.\n\nBut scientists say its benefits have now been demonstrated.\n\nIt uses a cold-type virus, engineered to be harmless, as a carrier to deliver a small fragment of the coronavirus to the body.', '15', '00', '999.00', NULL, '2021-05-25 10:43:13', '2021-05-25 10:43:13'),
(32, 88, '10', 'Covishield', 'The Oxford-AstraZeneca vaccine is being manufactured locally by the Serum Institute of India, the world\'s largest vaccine manufacturer. It says it is producing more than 60 million doses a month.\n\nThe vaccine is made from a weakened version of a common cold virus (known as an adenovirus) from chimpanzees. It has been modified to look more like coronavirus - although it can\'t cause illness.', '30', '00', '899.00', '2021-05-25 15:31:04', '2021-05-25 10:44:06', '2021-05-25 15:31:04'),
