(36, 87, '01', 'covid-19 test', 'A \"positive\" test means a person is infected with coronavirus, and a \"negative\" test means they aren\'t infected. But sometimes the test results aren\'t accurate. A test result can be negative even when someone has the virus. This is why some people get a second test. Rarely, the test may be positive in someone who doesn\'t have the virus.', '15', '00', '300.00', NULL, '2021-05-25 12:23:49', '2021-05-25 12:23:49'),
(37, 87, '04', 'Infection', 'Tests for Past Infection\nTo see if someone had coronavirus in the past, health care providers look for antibodies, which the body makes about 23 weeks after an infection. This can\'t tell if the person is infected at the time of the test, which is why this test isn\'t used to diagnose COVID-19.', '30', '00', '800.00', NULL, '2021-05-25 12:24:44', '2021-05-25 12:24:44'),
(38, 85, '01', 'Covid', 'This is a blood test, with a sample taken either from a vein or a fingertip (called a \"fingerstick\"). Results can be ready on the same day, or up to a week later. There\'s no home kit for antibody testing yet This is a blood test, with a sample taken either from a vein or a fingertip (called a \"fingerstick\"). Results can be ready on the same day, or up to a week later. There\'s no home kit for antibody testing ye', '15', '00', '300.00', NULL, '2021-05-25 13:14:09', '2021-05-25 13:14:09'),
