(40, 63, '01', 'Sugar check', 'The goal is always to keep your blood sugar in a healthy range: not too high and not too low. Heres an explanation of what normal blood sugar looks like.\nKeeping a blood sugar log is a very helpful tool for all diabetics. Write down your blood sugar test results, along with the date, time and what food you ate. This can make it easier to see if there are patterns in your blood sugar readings.', '30', '00', '400.00', NULL, '2021-05-25 13:33:01', '2021-05-25 13:33:01'),
