(79, 196, '01', 'Drug Addiction Coaching', 'This session is to introduce ourselves and have a brief conversation to get to know one another and discuss options to help you with your recovery.This session is to introduce ourselves and have a brief conversation to get to know one another and discuss options to help you with your recovery.This session is to introduce ourselves and have a brief conversation to get to know one another and discuss options to help you with your recovery.This session is to introduce ourselves and have a brief conversation to get to know one another and discuss options to help you with your recovery.', '15', '00', '50.00', NULL, '2021-10-19 17:54:17', '2021-10-19 17:54:17'),
(80, 294, '10', 'Recovery Coaching 1 Hour', 'A recovery coach works in a similar way to a life coach  they are there to offer encouragement and help the client build a better life. The aim with this type of help is far more than just getting the person sober; the real goal is for the client to reach his or her potential. Recovery coaching is available to those who are currently struggling with addiction problems or alternatively those already sober can use it to build a good life away from alcohol or drugs. In order to function in this type of role, the recovery coach will be expected to have had some type of formal training and qualifications.', '15', '00', '50.00', NULL, '2021-10-19 18:28:48', '2021-10-19 18:35:15'),
